import React, { Component } from "react";
import pic from "./poster1.jpg";

function Show() {
  return (
    <div className="Show">
      <div className="row">
        <h1>Top 10 Popular Movies</h1>
      </div>
      <div className="row">
        <h1>Top 10 Top-Rated Movies</h1>
      </div>
      <div className="row">
        <h1>Top 10 Upcoming Movies</h1>
      </div>
    </div>
  );
}

export default Show;
